import { useNavigate } from "react-router-dom"
import { Routes, Route } from "react-router-dom";


import Userpage from "./UserPage";
import Notfound from "./Notfound"
import AddGoal from "./AddGoal"


function PrivateRoutes(loggedIn, sendData, port, addAccount, addTransaction, backend, updateGoal, deleteTransaction, login){
let navigate = useNavigate()


if(loggedIn){


    return (
       <>
        <Route exact path="/loggedin/user" element={<Userpage port={port} addTransaction={addTransaction} sendData={sendData} backend={backend} updateGoal={updateGoal} deleteTransaction={deleteTransaction} />} />
        <Route exact path="/loggedin/addgoal" element={<AddGoal sendData={sendData} addAccount={addAccount} />} />
        <Route exact path="*" element={<Notfound />}></Route>
        </>
    )
    } else {
        navigate("/login")
    }

}


export default PrivateRoutes;
